import React from "react";


const App = () =>{
    return(
        <>
        <div className='Food_App'>
            <form className='From'>
                <input 
                type='text'
                className='input'
                placeholder='Serch...'
                />
                <button 
                className='button'
                type='submit'>
                    Search
                </button>
            </form>
        </div>
            
        </>
    );
};

export default App;
